Text = ""

Pattern = "GAAGGCAGA"

def PatternCount(Text, Pattern):
    # Returns the number of Pattern that occurs in Text
    count = 0
    for i in range(0, len(Text) - len(Pattern) + 1):
        if Text[i: i + len(Pattern)] == Pattern:
            count += 1
    return count

print(PatternCount(Text, Pattern))